async def request_body_to_args(
    required_params: List[ModelField],
    received_body: Optional[Union[Dict[str, Any], FormData]],
) -> Tuple[Dict[str, Any], List[ErrorWrapper]]:
    values = {}
    errors = {}

    if received_body is not None:
        for param in required_params:
            value = received_body.getlist(param.alias) if isinstance(received_body, FormData) else received_body.get(param.alias)
            if value is None or (isinstance(param, ModelField) and value == ""):
                if param.required:
                    errors[param.alias] = [ErrorWrapper(MissingError(), loc=("body", param.alias))]
                else:
                    values[param.name] = deepcopy(param.default)
            else:
                values[param.name], param_errors = param.validate(value, {}, loc=("body", param.alias))
                if isinstance(param_errors, ErrorWrapper):
                    errors[param.alias] = [param_errors]
                else:
                    errors[param.alias] = param_errors

    return values, list(errors.values())
